import ReactLoading from 'react-loading';

function PreLoader1(){
    const [data, setData] = useState([]);
    const [done,setDone] = useState([undefined]);

    useEffect(() => {
        setTimeout(() => {
            fetch('https://jsonplaceholder.typicode.com/posts')
        .then((response) => response.json())
        .then((json) => {
            setData(json);
            setDone(true);
        });
        },2000);
